import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/dogs">Dog Listing</Link>
        </li>
        <li>
          <Link to="/superwag">Super Wag List</Link>
        </li>
        <li>
          <Link to="/ratings">My ratings</Link>
        </li>
        <li>
          <Link to="/share links">Share Links</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
